ROW.LISAINFO_INFO:
Müüa Kuressaare kesklinnas kinnistu koos sellel paikneva renoveeritava kahekorruselise puitmajaga. Kinnistu suurus on 821 m², kinnistu on hea asukohaga, paikneb Torni ja Garnisoni tänava nurgal. 
Väga hea investeering, kuna kõik vajalik on olemas:
kehtestatud on detailplaneering;
olemas on krundi geodeetiline alusmõõdistus;
väljastatud on Muinsuskaitse eritingimused olemasoleva hoone renoveerimiseks;
olemas on hoone renoveerimise projekt (kokku 6 korterit – I korrusele üks 2-toaline ja kaks 3-toalist korterit, II korrusele kolm 2-toalist korterit);
elektriliitumine 3x25A. 
Võimalik osta ka naaberkinnistu suurusega 930 m² (kehtestatud detailplaneering, võimalik ehitada 2-korruseline kortermaja, ehitusalune pind 220 m²) hinnaga 1 450 000 EEK (92 671 EUR). 
Ostes mõlemad kinnistud korraga hind kokku 2 200 000 EEK (140 605 EUR).

Kinnistu asub Pärnu südalinna äripiirkonnas Rüütli, Ringi ja Hommiku tn vahelises kvartalis. Pärnu vanalinna keskuses Rüütli tn ääres. Ligipääs hoonele ja krundile on võimalik Rüütli, Ringi ja Hommiku tänavalt. 

Kinnistu on põhiplaanilt ristkülikukujuline, tasase reljeefiga. 

Kinnistu on hoonestatud. Hoone on tunnistatud arhitektuurimälestiseks (mälestise registrinumber 24257). 

Kinnistul paikneva hoone ruumidest on ruumid üldpinnaga 976,2m2 kuni 01. oktoobrini 2014 koormatud rendilepinguga OÜ Pärnu Kaubabörs (registrikood 10340748) kasuks, mille kohta on tehtud ka märge kinnistusraamatusse. Rendilepingu punktis 5.5 sätestatud rendileandja kohustuse täidab ostja. 

Hoone ruumides, mis ei ole rendilepinguga koormatud paikneb muinsuskaitse all olev apteegi sisustuse, mille omanik on AS Pharmac (registrikood 10082737). 

Hoone esmane kasutuselevõtu aasta ehitisregistri andmetel on 1867. 

Hoone suletud netopind 1214,7 m2. 

Hoone põhikonstruktsioonid: 
vundament - maakivi, betoon; 
välisseinad - tellised ja/või väikeblokid, krohvitud - värvitud; 
vahelaed - betoon; 
katusekandjad - puitsarikad; 
katusekate - profiilplekk; 
aknad - puitraamidel; 
uksed - puit. 

Hoone veevarustus on linnatrassist ja heitveed kanaliseeritakse linnatrassi. Hoones on kaugkeskküte ja elektriküte, elektrivarustus 220/380V.

