Müüa Kuressaare kesklinnas kinnistu koos sellel paikneva renoveeritava kahekorruselise puitmajaga. Kinnistu suurus on 821 m², kinnistu on hea asukohaga, paikneb Torni ja Garnisoni tänava nurgal. 
Väga hea investeering, kuna kõik vajalik on olemas:
- kehtestatud on detailplaneering;
- olemas on krundi geodeetiline alusmõõdistus;
- väljastatud on Muinsuskaitse eritingimused olemasoleva hoone renoveerimiseks;
- olemas on hoone renoveerimise projekt (kokku 6 korterit – I korrusele üks 2-toaline ja kaks 3-toalist korterit, II korrusele kolm 2-toalist korterit);
- elektriliitumine 3x25A. 
Võimalik osta ka naaberkinnistu suurusega 930 m² (kehtestatud detailplaneering, võimalik ehitada 2-korruseline kortermaja, ehitusalune pind 220 m²) hinnaga 1 450 000 EEK (92 671 EUR). 
Ostes mõlemad kinnistud korraga hind kokku 2 200 000 EEK (140 605 EUR).

Kinnistu asub Pärnu rannarajoonis, A.H.Tammsaare pst, Kuuse ja Papli tänavate nurgal. Kaugus südalinnast (tinglikult loetakse selleks Rüütli tänavat) on u 1 kilomeeter. Kaugus supelrannast u 300 meetrit. 

Kinnistu asub Pärnu vanalinna ja kuurordi muinsuskaitsealal (mälestise registri number 27007). 

Kinnistu on korrapärase ristküliku kujuga ja piirneb kolmest küljest tänavatega ja ühest küljest naaberkinnistuga. Kinnistu on tasase reljeefiga. Kinnistu on heakorrastatud haljastatud ja ilupuude ning -põõsastega. Krunt on ümbritsetud aia ja hekiga. 

Kinnistul asuvas hoonetekompleksis tegutses vanurite hooldekodu, mis kolis uutesse ruumidesse 2008. aasta märtsis. Hoonetekompleksi kuulub kolm hoonet: puhkekodu, söökla ja klubi. 

Puhkekodu on tunnistatud arhitektuurimälestiseks, mälestise nimi “pansionaadihoone Pärnus” (mälestise registrinumber 27832). 

Teadaolevalt on pansionaadihoone projekteeritud 1890-tel aastatel ning on Pärnu 19. ja 20. sajandivahetuse supelarhitektuuri silmapaistev näide. Tegemist on silmapaistvalt suure, spetsiaalselt pansionaadiks kavandatud hoonega. Kuigi nõukogude sõjaväe käes olles on siseruumid tundmatuseni ümber ehitatud on eksterjöör säilinud valdavalt originaalis. 

Hoone suletud netopind 934,3 m2 

Hoone põhikonstruktsioonid: 
vundament - maakivi; 
välisseinad - rõhtpalk, kaetud laudvoodriga; 
vahelaed - puit; 
katusekandjad - puitsarikad; 
katusekate - valtsplekk; 
aknad - kahekordsete klaasidega puitaknad; 
uksed - puit. 

Hoone veevarustus on linnatrassist ja heitveed kanaliseeritakse linnatrassi. Hoones on kaugkeskküte, elektrivarustus 220/380V, valve- ja tuletõrjesignalisatsioon, telefoniside. 

Kinnistul asuv söökla on suletud netopinnaga 423,9 m2  

Hoone põhikonstruktsioonid: 
vundament - betoon; 
välisseinad - puitsõrestiktäidissein, kaetud laudvoodriga; 
vahelaed - puit; 
katusekandjad - puitsarikad; 
katusekate - valtsplekk, katusepapp; 
aknad - kahekordsete klaasidega puitraamidel; 
uksed - puit. 

Kinnistul asuv klubihoone on suletud netopind: 188 m2 . 

Hoone põhikonstruktsioonid: 
vundament - betoon; 
välisseinad - tellis; 
vahelaed - puit, osaliselt betoon; 
katusekate - eterniit.

Hoone mõõdistusprojekt olemasolevale ruumilahendusele puudub.

Müüa arenevas ja looduskaunis, NURME-JÕE elamurajoonis, hoonestamata elamumaad asukohaga Eametsa küla, Sauga vald, Pärnumaa. Kinnistud asuvad Sauga jõe ja metsa vahel, Pärnu kesklinnast 10 minuti autosõidu kaugusel ja Tallinnast 120 km. Elamualal on 61 kinnistut, millest müüdud on 49. Elamualal on rajatud kõik kommunikatsioonid: elekter 3x16A, tsentraalne vesi ja kanalisatsioon, 2 tuletõrje veemahutit, sidekaabel (võimalik liituda Elioni Digi TV täislahendusega), tänavavalgustus, asfaldkattega teed. Kõik kommunikatsioonid on üle antud kohalikule omavalitsusele. 2 km kaugusel asuvad Sauga valla keskus, kauplus, baar, vallavalitsus ja lasteaed. Bussipeatuseni on ca 1km kus väljuvad bussid nr 42-1, 42-2, 42-3, 42-4, 47, 48-1, 48-2 ja 57 ning hulgaliselt kaugliinide autobusse. Kinnistu asub 150 m kaugusel Sauga jõest, mis on väga populaarne koht kalastamiseks ja mille kallasrajale on vaba ligipääs. 

